import React from 'react'
import styled from 'styled-components';

/*
Light Lime: #abd699

Fresh Lemon: #ffe26a

Teal: #75c9b7

Mint: #c7ddcc

Navy: #16123f
*/

const Header = () => {
  return (
    <HeaderContainer>
    <div className='header'>

        <h1>A Fantasy Football Website</h1>

    </div>
    </HeaderContainer>
  )
}

const HeaderContainer = styled.div`
.header {
    padding: 10px;
    text-align: center;
    background: #abd699;
    color: white;
    font-size: 30px;
  }
`;

export default Header
